import React from "react";

function Nav(props) {
  const {
    setCurrentPage,
    pages=[],
    currentPage,
  } = props;
//create nav bar for your stuff
  return (
    <header className="flex-row">
      <h1> <a href="/">Edmer Valencia</a></h1>
      <nav>
      <ul className="flex-row h100 align-center">
                    {pages.map(page => (
                        <li className={`my mx-2 ${page.name === currentPage.name && 'navActive'}`} key={page.name}>
                            <span onClick={() => {
                                setCurrentPage(page)
                            }}
                        >
                            {page.name}
                        </span>
                        </li>
                    ))}
                </ul>
      </nav>
    </header>
  );
}

export default Nav;
